import React from "react";

class User extends React.Component {
  user = this.props.user;
  render() {
    return (
      <div className="user">
        <h3>
          {firstname} {el.lastname}
        </h3>
        <p>{el.bio}</p>
        <b>{el.isHappy ? "happy:)" : "not much:("}</b>
      </div>
    );
  }
}

export default User;
